import React from 'react'

class Badgeform extends React.Component {
    render() {
        return (
            <div className="">
            <h1>nuevo formulario</h1>
                <form action="">
                    <div className="form-group">
                        <label htmlFor="">Nombre</label>
                    </div>
                    
                </form>
                
            </div>
        )
    }
}

export default Badgeform
